import React, { useState } from "react";
import "./Test.css"; // Add your styles here

const Test = () => {
  const [folders, setFolders] = useState(["Computer Networks"]);
  const [forms, setForms] = useState([]);

  const addFolder = () => {
    const newFolder = `New Folder ${folders.length + 1}`;
    setFolders([...folders, newFolder]);
  };

  const addForm = () => {
    const newForm = `New Form ${forms.length + 1}`;
    setForms([...forms, newForm]);
  };

  return (
    <div className="dashboard">
      <div className="header">
        <button onClick={addFolder} className="btn">
          Create a folder
        </button>
        {folders.map((folder, index) => (
          <div key={index} className="folder">
            {folder}
            <button className="delete-btn">üóëÔ∏è</button>
          </div>
        ))}
      </div>
      <div className="grid-container">
        <div className="typebot">
          <button onClick={addForm} className="btn create-btn">
            Create a typebot
          </button>
        </div>
        {forms.map((form, index) => (
          <div key={index} className="form">
            {form}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Test;
